import React from "react";
import logo from "./logo.svg";
import "./App.css";


function App() {

function mudarCor(){
  const obj = document.getElementById("color")

  if(obj.className === "red"){
    obj.classList.replace("red","white")
  }else{
    obj.classList.replace("white", "red")
  }

  console.log(obj.className)

}; 



  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>
          <strong function={setInterval(mudarCor, 1000)} id="color" className="red">Blog </strong>
          do Paulo Spiguel
        </h1>
        <p>Em breve mais novidades...</p>
      </header>
    </div>
  );
}

export default App;
